function splash_init() {
	if ($('body').is('.lt-ie6 *')) return;

	var show_splash;
	var cookie_name = "splashed";

	show_splash = 1;
	if (show_splash == 1 && document.cookie.indexOf(cookie_name + "=1") >= 0) {
		show_splash = 0;
	}
	if (show_splash) {
		document.cookie = cookie_name + "=1; max-age=" + 31536000; //1 year
		$('body').prepend($('#ribbon'));
		$("#ribbon").show();
	}
}

$(function() {
	splash_init();
	$('#ribbon .close').click(function(e) {
		e.preventDefault();
		$("#ribbon").slideUp();
		return false;
	});
});

function inlineSvgs(selector) {
	if (typeof selector == 'undefined'){
		selector = 'img[data-force-inline]';
	}
	if (!$('html').hasClass('lt-ie9')) {
		$(selector).each(function(){
				var $img = $(this);
				var imgID = $img.attr('id');
				var imgClass = $img.attr('class');
				var imgURL = $img.attr('src');

				$.get(imgURL, function(data) {
						// Get the SVG tag, ignore the rest
						var $svg = $(data).find('svg');

						// Add replaced image's ID to the new SVG
						if(typeof imgID !== 'undefined') {
								$svg = $svg.attr('id', imgID);
						}
						// Add replaced image's classes to the new SVG
						if(typeof imgClass !== 'undefined') {
								$svg = $svg.attr('class', imgClass+' replaced-svg');
						}

						// Remove any invalid XML tags as per http://validator.w3.org
						$svg = $svg.removeAttr('xmlns:a');

						// Check if the viewport is set, if the viewport is not set the SVG wont't scale.
						if(!$svg.attr('viewBox') && $svg.attr('height') && $svg.attr('width')) {
								$svg.attr('viewBox', '0 0 ' + $svg.attr('height') + ' ' + $svg.attr('width'))
						}

						// Replace image with new SVG
						$img.replaceWith($svg);

				}, 'xml');
		});		
	}
}

$(function() {
	inlineSvgs();
	if (!Modernizr.svg) {
		$('img').each(function() {
			var $t = $(this);
			var src = $t.attr('src');

			if (src.toLowerCase().substring(src.length - 4, src.length) == '.svg') {
				var alt = $t.data('svg-alt');
				if (alt) {
					if (alt == 'auto') {
						$t.attr('src', src.substring(0, src.length - 4) + '.png');
					} else {
						$t.attr('src', alt);
					}
				}
			}
		});
	}
});
$.inRegExArray = function(str, arrayOfRegEx, start) {
    if (!arrayOfRegEx) return -1;
    start = start || 0;
    for (var i = start; i < arrayOfRegEx.length; i++) {
        if (arrayOfRegEx[i].test(str)) {
            return i;
        }
    }
    return -1;
};

var IsExternal = (function() {
	var checkDomain = function(url) {
		if (url.indexOf('//') === 0) {
			url = location.protocol + url;
		}
		if (url.substring(0, 4) != 'http') {
			return false;
		}
		var d = url.toLowerCase().replace(/([a-z]*)?(:\/\/)/, '').split('/')[0];
		if (d.substring(0, 4) == 'www.') {
			d = d.substring(4);
		}
		return d;
	};
	var localDomains = [
			new RegExp('//[^/]*' + checkDomain(location.href), 'i')];
	var customDomains = $('body').data('local-domains');

	if (typeof customDomains == 'string') {
		customDomains = customDomains.split(',');
	} else {
		customDomains = [];
	}
	for (var i = 0; i < customDomains.length; i++) {
		var d = $.trim(customDomains[i]);
		if (d.length > 0) {
			localDomains.push(new RegExp(d, 'i'));
		}
	}

	return function(url) {
		if (url === undefined)
			return false

		return ((url.indexOf(':') > -1 || url.indexOf('//') > -1) &&
			$.inRegExArray(url, localDomains) < 0 && url.indexOf('mailto') != 0
			);
	}
})();

$.fn.addFancyTooltips = function() {
	var targets = $(this).find('[rel~=tooltip]'),
		target = false,
		tooltip = false,
		title = false;

	targets.bind('mouseenter', function() {
		target = $(this);
		var tip = target.attr('title');
		tooltip = $('<div id="tooltip"></div>');

		if (!tip || tip == '')
			return false;

		target.removeAttr('title');
		tooltip.css('opacity', 0)
			.html(tip)
			.appendTo('body');

		var init_tooltip = function() {
			var mw = Math.min($(window).width() * .75, 600);
			if ($(window).width() < tooltip.outerWidth() * 1.5)
				tooltip.css('max-width', mw + 'px');
			else
				tooltip.css('max-width', 340);

			var pos_left = target.offset().left + (target.outerWidth() / 2) -
				(tooltip.outerWidth() / 2),
				pos_top = target.offset().top - tooltip.outerHeight() - 20;

			if (pos_left < 0) {
				pos_left = target.offset().left + target.outerWidth() / 2 - 20;
				tooltip.addClass('left');
			} else
				tooltip.removeClass('left');

			if (pos_left + tooltip.outerWidth() > $(window).width()) {
				pos_left = target.offset().left - tooltip.outerWidth() +
				target.outerWidth() / 2 + 20;
				tooltip.addClass('right');
			} else
				tooltip.removeClass('right');

			if (pos_top < 0) {
				var pos_top = target.offset().top + target.outerHeight();
				tooltip.addClass('top');
			} else
				tooltip.removeClass('top');

			tooltip.css({
				left: pos_left,
				top: pos_top
			})
				.animate({
					top: '+=10',
					opacity: 1
				}, 50);
		};

		init_tooltip();
		$(window).resize(init_tooltip);

		var remove_tooltip = function() {
			tooltip.animate({
				top: '-=10',
				opacity: 0
			}, 50, function() {
				$(this).remove();
			});

			target.attr('title', tip);
		};

		target.bind('mouseleave', remove_tooltip);
		tooltip.bind('click', remove_tooltip);
	});	
};

$.fn.addTooltipsForExternalLinks = function() {
	var externalNotice = $('body').data('external-notice');
	if (typeof externalNotice == 'string') {
		externalNotice = $.trim(externalNotice);
	}
	if (typeof externalNotice != 'string' || externalNotice.length < 1) {
		externalNotice = 'Please note: If you click this link, you will ' +
			'leave this website.';
	}
	$(this).find('a').each(function() {
		var $t = $(this);
		if (IsExternal($t.attr('href')) && ($t.attr('rel') != 'tooltip')) {
			var tipText = externalNotice;
			$t.attr('title', tipText);
			$t.attr('rel', 'tooltip');
			// if all external links are supposed to open
			// in a separate window :
			// $t.attr('target', '_blank');
		}
	});
	$(this).addFancyTooltips();
};

$(function() {
	$('body').addTooltipsForExternalLinks();
});


