function getPageUrl() {
	// Mostly borrowed from https://github.com/browserstate/history.js
	var doc = document;
	var loc = doc.location;
		
	if (loc.href === doc.URL || loc.href === decodeURIComponent(doc.URL)) {
		return doc.URL;
	} else if (loc.hash && decodeURIComponent(loc.href.replace(/^[^#]+/, '')) === loc.hash) {
		return loc.href;
	} else if (doc.URL && doc.URL.indexOf('#') === -1 && loc.href.indexOf('#') !== -1) {
		return loc.href;
	}
	return '' + (doc.URL || loc.href);
}

function getHashFromUrl(url) {
	// Mostly borrowed from https://github.com/browserstate/history.js
	var match = ('' + url).match(/#([^#]*)$/);
	var hash = match ? match[1] : '';
	return '#' + decodeURIComponent(hash);
}

