/**
 * attachment tabs
 */

$(function() {
	var $section = $('section#attachments');
	var $menu_li = $section.find('.menu li');
	var $panels = $section.find('.panel');

	$section.find('.menu a').click(function(e) {
		var $this = $(this);
		var $li = $this.closest('li');
		var open = true;

		if ($li.hasClass('active')) {
			open = false;
		}

		$menu_li.removeClass('active');
		$panels.removeClass('active');
		if (open) {
			$li.addClass('active');
			$section.find($this.attr('href')).addClass('active');
			$menu_li.velocity('scroll');
		}
		e.preventDefault();
		return false;
	});
});
